	(13054,1,'2015-02-18 01:56:31','2015-02-17 17:56:31','[fullwidth backgroundcolor=\"\" backgroundimage=\"\" backgroundrepeat=\"no-repeat\" backgroundposition=\"left top\" backgroundattachment=\"scroll\" video_webm=\"\" video_mp4=\"\" video_ogv=\"\" video_preview_image=\"\" overlay_color=\"\" overlay_opacity=\"0.5\" video_mute=\"yes\" video_loop=\"yes\" fade=\"no\" bordersize=\"0px\" bordercolor=\"\" borderstyle=\"\" paddingtop=\"20px\" paddingbottom=\"20px\" paddingleft=\"0px\" paddingright=\"0px\" menu_anchor=\"\" equal_height_columns=\"no\" hundred_percent=\"no\" class=\"\" id=\"\"][fusion_text]LSC provides services related to raising capital in the private markets, either for growth, balance sheet restructuring or liquidity for one or more partners.\n<ul>\n	<li>Our corporate finance valuation and transaction expertise allow us to effectively structure and position private capital issuance</li>\n	<li>LSC has significant and tenured relationships with most equity firms and funds as well as with numerous money management firms interested in private investments, including hedge funds and sovereign funds.</li>\n	<li>Our ability to create a competitive, yet timely process ensures that we receive the best available market pricing for a private capital raise at the time of issuance.</li>\n</ul>\n[/fusion_text][/fullwidth]','Capital Raising','','publish','open','open','','capital-raising-for-growing-companies-and-startups','','','2015-02-18 01:56:31','2015-02-17 17:56:31','',0,'http://www.lionstatecapital.com.sg/?page_id=13054',0,'page','',0),
